import React from 'react'
import {
  Button,
  Col,
  Form,
  FormControl,
  InputGroup,
  Row,
} from 'react-bootstrap'

import data from '../Utils/data'

const Home = () => {
  return (
    <div>
      {
        <Form>
          {data.map((item) => (
            <InputGroup className='mb-3' key={item.id}>
              <InputGroup.Prepend>
                <InputGroup.Text>{item.question}</InputGroup.Text>
              </InputGroup.Prepend>
              <FormControl />
            </InputGroup>
          ))}
          <Button variant='info' type='submit'>
            Submit
          </Button>
        </Form>
      }
    </div>
  )
}

export default Home
